import React from "react";

function Movie(props){
   
    function handleClick(event){
       event.preven
    }
    return (
      <div className="term">
      
       <img className="image" src={props.poster} height="450" width="300"/>
     

      <dt>
      <h3>Title: {props.title}</h3>
      <p> Genre: {props.genre}</p>
      <form action="/" method="post">
      <button type="button" class="btn btn-outline-info" onClick={handleClick}>Book Now</button>
      </form>
      </dt>
      
      
    </div>
    );
}


export default Movie;
